import React from "react";

function Card({ user }) {
  return (
    <div className="max-w-sm p-2 border">
      <div className="text-2xl font-semibold text-gray-900">{user?.name}</div>
      <div className="font-bold text-lg">{user?.occupation}</div>
      <div className="text-blue-800">{user?.email}</div>
      <div className="text-sm text-gray-600">{user?.bio}</div>
    </div>
  );
}

export default Card;
